import React from 'react';
import ReactDOM from 'react-dom/client';
import { App } from './App';
import { Server } from 'http';


createServer({
  routes(): void {
    this.get("offers/", () => ({
      reminders: [],
    }))
  },
})



const root = ReactDOM.createRoot(
  document.getElementById('root') as HTMLElement
);
root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);
